pragma solidity ^0.4.17;

import "./Mortal_BlocKYC.sol";

contract StorageBlocKYC is OwnedBlocKYC, MortalBlocKYC {

    /*Access Modifiers */
    //Stores address of contracts which can use this storage
    address bankContract;
    address customerContract;

    //Setter for Access modifiers
    function setBankContract(address _bankContractAddress) external onlyOwner {
        bankContract = _bankContractAddress;
    }

    //Setter for Access modifiers
    function setCustomerContract(address _customerContractAddress) external onlyOwner {
        customerContract = _customerContractAddress;
    }

    //------------------------------------- Customer Data and storage - Customer View -------------------------------------//
    struct Customer {
        bytes32 name;
        mapping(address => bool) banks;
        bytes32 hashOfData;
        bool isVerified;
        bool initialized;
    }
    
    mapping (address => bool) private bankList;
    mapping(address => Customer) private customerData;

    //getter bankList
    function isBank(address _bankAddress) external view returns (bool) {
        return bankList[_bankAddress];
    }

    //setter bankList
    function addBankToBankList(address _bankAddress) external {
        require(msg.sender == bankContract);    //Can be called only by bank contract
        require(bankList[_bankAddress] == false); //Bank should not be already added
        bankList[_bankAddress] = true;
    }

    //getter customerData from Bank contract
    function getCustomerDataForBank(address _customerAddress, address _bankAddress) external view returns (
        bytes32,
        bytes32,
        bool
        ) {
            require(msg.sender == bankContract);    //Can be called only by bank contract
            require(customerData[_customerAddress].banks[_bankAddress]); //Can be called only by a bank that the customer has added to it's list
            return (
                customerData[_customerAddress].name,
                customerData[_customerAddress].hashOfData,
                customerData[_customerAddress].isVerified
            );
    }

    //getter customerData from Bank contract
    function getCustomerDataForCustomer(address _customerAddress) external view returns (
        bytes32,
        bytes32,
        bool
        ) {
            require(msg.sender == customerContract);    //Can be called only by customer contract
            return (
                customerData[_customerAddress].name,
                customerData[_customerAddress].hashOfData,
                customerData[_customerAddress].isVerified
            );
    }

    //setter customerData
    function addCustomerToCustomerData(address _customerAddress, bytes32 _name, bytes32 _hashOfData) external {
        require(msg.sender == customerContract);    //Can be invoked only by Customer contract
        require(!customerData[_customerAddress].initialized);   //Customer should not be already added

        customerData[_customerAddress] = Customer(_name, _hashOfData, false, true);
    }

    //setter bank list in customer data
    function addBankToCustomer(address _appliedBank, address _customerAddress) external {
        require(msg.sender == customerContract);    //Can be invoked only by Customer contract
        require(customerData[_customerAddress].initialized);  //Customer should be already added
        customerData[msg.sender].banks[_appliedBank] = true;
    }

    //setter hashOfData in customer data
    function changeCustomerData(address _customerAddress, bytes32 _hashOfData) external {
        require(msg.sender == customerContract);    //Can be invoked only by Customer contract
        require(customerData[_customerAddress].initialized);  //Customer should be already added

        customerData[_customerAddress].hashOfData = _hashOfData;
        customerData[_customerAddress].isVerified = false;
    }

    //setter of verified field in customer data
    function verifyCustomer(address _customerAddress, address _bankAddress) external {
        require(msg.sender == bankContract);    //Can be called only by bank contract
        require(customerData[_customerAddress].banks[_bankAddress]); //Can be called only by a bank that the customer has added to it's list
        customerData[_customerAddress].isVerified = true;
    }

    //------------------------------------------- Customer Data - Bank View ----------------------------------------------//
    struct CustomerDetailsByBank {
        bool initialized;
        bool isVerified;
        bool isFlagged;
        address verifierBank;
        address flaggingBank;
    }

    mapping (address => CustomerDetailsByBank) private bankNetworkToCustomerDetailsMap;

    //Getter of bankToCustomerDetailsMap
    function getCustomerDetailsFromNetwork (address _customerAddress) external view returns (bool, bool, bool, address) {
        require(msg.sender == bankContract);    //Can be called only by bank contract
        return(
            bankNetworkToCustomerDetailsMap[_customerAddress].initialized,
            bankNetworkToCustomerDetailsMap[_customerAddress].isVerified,
            bankNetworkToCustomerDetailsMap[_customerAddress].isFlagged,
            bankNetworkToCustomerDetailsMap[_customerAddress].verifierBank
        );
    }

    function verifyCustomerInNetwork (address _customerAddress, address _verifierBank) external {
        require(msg.sender == bankContract);    //Can be called only by bank contract
        bankNetworkToCustomerDetailsMap[_customerAddress].initialized = true;
        bankNetworkToCustomerDetailsMap[_customerAddress].isVerified = true;
        bankNetworkToCustomerDetailsMap[_customerAddress].verifierBank = _verifierBank;    
    }

    function flagCustomerInNetwork (address _customerAddress, address _flaggingBank) external {
        require(msg.sender == bankContract);    //Can be called only by bank contract
        require(bankNetworkToCustomerDetailsMap[_customerAddress].initialized);
        bankNetworkToCustomerDetailsMap[_customerAddress].isFlagged = true;
        bankNetworkToCustomerDetailsMap[_customerAddress].flaggingBank = _flaggingBank;    
    }
}
